            <button type="radio" onClick={() => setIsClicked(!isClicked)}></button>
                      <li>Employee</li>
                      <li>Postion</li>
                      <li>Location</li>
                      <li>Salary</li>
                      <li className='text-none'>Actions</li>
                      {isClicked && (
                          <div></div>
                      )}

      </header>
    </div>
  );
};

export default HeaderComponent;
